class Solution {
    func lengthOfLongestSubstring(_ s: String) -> Int {
        let tempString: Substring = Substring(s)
        if tempString.isEmpty || tempString.count == 0 {
            return 0
        }
        var hashMap: [Int : Int] = Dictionary.init()
        var minIndex = 0, maxIndex = minIndex, index = minIndex, maxCount = 0
        while index < tempString.count {
            let char = tempString[.init(encodedOffset: index)]
            let keyValue: Int = Int(String(char).utf8.first!)
            if !hashMap.keys.contains(keyValue) {
                hashMap[keyValue] = index
            } else {
                if hashMap[keyValue]! < minIndex {
                    hashMap[keyValue] = index
                } else {
                    minIndex = hashMap[keyValue]! + 1
                    hashMap[keyValue]! = index
                }

            }
            index += 1
            maxIndex = index
            let newMaxCount = maxIndex - minIndex
            maxCount = maxCount > newMaxCount ? maxCount : newMaxCount;
        }
        return maxCount
    }
}


